import React from 'react'
import {useState} from 'react'
import {AiFillFilePdf} from 'react-icons/ai'
const Pdf = ({pdf}) => {
    const [isEnterMouse,setIsEnterMouse]=useState(false);
    const handleBackground=state=>{
        setIsEnterMouse(state);
    }
    return (
        <div 
            onMouseEnter={()=>handleBackground(true)}
            onMouseLeave={()=>handleBackground(false)}
            style={isEnterMouse?{backgroundColor:'silver'}:{backgroundColor:'white'}}
        >   
            <div> 
                <div style={{textAlign:"center"}}>
                    <AiFillFilePdf style={{color:'red'}}/>
                    <a href={pdf.pdf_link} target="_blank" rel="noopener noreferrer">
                        {pdf.pdf_name}
                    </a>
                </div>
                <div style={{textAlign:"right"},{float:'right'}}>
                    {pdf.pdf_date}
                </div>
            </div>
        </div>
    )
}

export default Pdf
